import { useSelector } from "react-redux"
import './play.css'
/* <h2 className="">{mean.means}</h2>
<h2>{mean.word.substring(0 , 100)}</h2>
<bottom>Next</bottom> */
const Play =  () => {
    const mean = useSelector(state => state.mean)

    const renderedwords = mean.map(mean => (
      <section>
           <main>
            <div className="thefront">
            <h2 className="">{mean.means}</h2>
            </div>
            <div className="theback">
            <h2>{mean.word.substring(0 , 100)}</h2>
            </div>
           </main>
     </section>
    ))

    return (
            {renderedwords}
    )
}

export default Play
